import React from 'react'
import '../signin/signin.styles.scss';

class SignIn extends React.Component{

    constructor(props){
        super(props);

        this.setState={
            email:'',
            password:''
        }
    }


    render(){
        return (
        <form>
        <input type="email">{this.state.email}</input>
        <input type="password">{this.state.password}</input>
        <input type="submit">Submit</input>
        </form>
        )
    }
}

export default SignIn;
